import React, { useEffect, useState } from 'react';
import { Link } from 'react-router-dom';
import Skeleton from 'react-loading-skeleton';
import { useDispatch } from 'react-redux';
import { addCart } from '../redux/action';
import { Footer, Navbar } from '../components';

const Products = () => {
  const [products, setProducts] = useState([]);
  const [loading, setLoading] = useState(true);

  const dispatch = useDispatch();

  const addProduct = (product) => {
    dispatch(addCart(product));
  };

  // Sample local product data
  const localProductsData = [
    { id: 1, title: 'КЕҢЖЕЙДЕ MDRN IDENTITY', price: 26, image: './assets/image1.jpeg', description: 'АҚ' },
    { id: 2, title: 'КЕҢЖЕЙДЕ MDRN IDENTITY', price: 26, image: './assets/image2.jpeg', description: 'КӨК' },
    { id: 2, title: 'КЕҢЖЕЙДЕ MDRN IDENTITY', price: 26, image: './assets/image3.jpeg', description: 'ҚОЮ КӨК' },
    { id: 2, title: 'КЕҢЖЕЙДЕ MDRN IDENTITY', price: 26, image: './assets/image4.jpeg', description: 'АҚ' },
    { id: 2, title: 'ФУТБОЛКА JAQSY KÜNDER', price: 19.99, image: './assets/image5.jpeg', description: 'САРҒЫШ' },
    { id: 2, title: 'ФУТБОЛКА EST.1465', price: 19.99, image: './assets/image6.jpeg', description: 'АҚ' },
    { id: 2, title: 'ФУТБОЛКА EST.1465', price: 19.99, image: './assets/image7.jpeg', description: 'КҮЛГІН' },
    { id: 2, title: 'ФУТБОЛКА EST.1465', price: 19.99, image: './assets/image8.jpeg', description: 'ҚОЮ САРЫ' },
    { id: 2, title: 'КЕПКА QR', price: 19.99, image: './assets/image10.jpeg', description: 'ҚАРА' },
    { id: 2, title: 'КЕПКА QR', price: 19.99, image: './assets/image11.jpeg', description: 'КӨК' },
    { id: 2, title: 'КЕПКА QR', price: 19.99, image: './assets/image12.jpeg', description: 'Description for product 2' },
    { id: 2, title: 'КЕПКА QR', price: 19.99, image: './assets/image13.jpeg', description: 'ҚЫЗЫЛ' },
    { id: 2, title: 'Product 2', price: 19.99, image: './assets/image14.jpeg', description: 'Description for product 2' },
    { id: 2, title: 'Product 2', price: 19.99, image: './assets/image15.jpeg', description: 'Description for product 2' },
    { id: 2, title: 'Product 2', price: 19.99, image: './assets/image16.jpeg', description: 'Description for product 2' },
    { id: 2, title: 'Product 2', price: 19.99, image: './assets/image17.jpeg', description: 'Description for product 2' },
    // Add more product objects as needed
  ];

  useEffect(() => {
    setTimeout(() => {
      setProducts(localProductsData);
      setLoading(false);
    }, 1000); // Simulate loading delay (e.g., 1 second)
  }, []);

  const Loading = () => {
    return (
      <div className="container my-5 py-3">
        <div className="row">
          {[...Array(4)].map((_, index) => (
            <div className="col-md-3 col-sm-6 mb-4" key={index}>
              <Skeleton height={250} width={200} />
              <Skeleton height={20} width={150} />
              <Skeleton height={50} />
            </div>
          ))}
        </div>
      </div>
    );
  };

  const ShowProducts = () => {
    return (
      <div className="container my-5 py-3">
        <div className="row">
          {products.map((product) => (
            <div key={product.id} className="col-md-3 col-sm-6 mb-4">
              <div className="card h-100">
                <img src={product.image} className="card-img-top" alt={product.title} />
                <div className="card-body">
                  <h5 className="card-title">{product.title}</h5>
                  <p className="card-text">${product.price}</p>
                  <p className="card-text">{product.description}</p>
                  <button className="btn btn-dark" onClick={() => addProduct(product)}>
                    Add to Cart
                  </button>
                  <Link to={`/product/${product.id}`} className="btn btn-outline-dark mx-2">
                    View Details
                  </Link>
                </div>
              </div>
            </div>
          ))}
        </div>
      </div>
    );
  };

  return (
    <>
      <Navbar />
      <div className="container">
        <div className="row">
          {loading ? <Loading /> : <ShowProducts />}
        </div>
      </div>
      <Footer />
    </>
  );
};

export default Products;
